import React from 'react';
import Radium from 'radium';

const Todos = props => {
  console.log('from todos...', props.sendIsCompleted);

  return (
    <div>
      <li>
        <ul
          style={
            (listStyle,
            props.sendIsCompleted ? { textDecoration: 'line-through' } : null)
          }
        >
          {props.todo}
        </ul>
      </li>

      <button onClick={props.completed}>Mark Completed</button>
      <button onClick={props.deleteTask}>Delete Task</button>
    </div>
  );
};

const listStyle = {
  listStyleType: 'none',
  border: '2px solid grey',
  backgroundColor: '#fffdd0',
  width: '55%',
  margin: 'auto'
};

export default Todos;
